import { View, Text, TouchableOpacity } from 'react-native'

export function NavBar() {
    return (
        <View style={{backgroundColor: rgba(0, 0, 0, 1)}}>
            <View style={{position: 'absolute', zIndex: 1, width: '100%', height: 161, backgroundColor: '#FFFFFF', borderTopLeftRadius: 12, borderTopRightRadius: 12}}>

            </View>
        </View>
    )
}
